import React, { Component } from 'react';
import '../logins.css'
class Logins extends Component {
    render() {
        return (
            <div >
                <form>
                <label className = "label-al">
                Username:
                <input type = "text" name = "name" />

                </label>
                <label>
                Password:
                    <input type="text" name = "name" />
                </label>
                </form>

            </div>

        )
      }
    } 

export default Logins;
